import React from "react";
import newp from "./NewPost.module.css"

const NewPost = () => {
    return (
        <div className={newp.postedit}>
            <span className={newp.mypost}>Мои посты</span>
            <div className={newp.text}>
                <textarea className={newp.textarea} placeholder="Что нового?"></textarea>
                <button><i className="fas fa-paper-plane" alt="send" /></button>
            </div>
        </div>
    );
}

export default NewPost;
